const QuestionDifficultys = ({difficultys, getDifficulty}) => {
    return (
        <section>
            <header>
                <h1>Schwierigkeit-Wählen:</h1>
            </header>
            <ul className="quizDifficulty">



                <li value="Easy" className="listItem">Easy</li>
                <li value="Medium" className="listItem">Medium</li>
                <li value="Hard" className="listItem">Hard</li>
            
            </ul>
        </section>
    );
};
